import { Component, OnInit } from '@angular/core';
import {createpdf} from '../pdfmake-helper/pdfmake';

@Component({
  selector: 'app-feedback-report',
  templateUrl: './feedback-report.component.html',
  styleUrls: ['./feedback-report.component.sass']
})
export class FeedbackReportComponent implements OnInit {

  courseId = 'TX101';
  course = 'Introduction to Programming';
  faculty = 'Dr. Stephen Strange';
  feedback = [9, 8, 7, 6, 5, 5, 2, 8, 9, 10];
  // feedback = [9, 8, 7, 6, 5];

  constructor() { }

  ngOnInit(): void {
  }

  download(): void {
    const docDefinition = {
      pageSize: 'A4',
      pageMargins: [ 40, 120, 40, 40 ],
      header : this.getHeader(),
      content: this.getContent(this.courseId, this.course, this.faculty, this.feedback),
      defaultStyle: {
        fontSize: 12,
        lineHeight: 1.2
      },
      styles: {
        center: {
          alignment: 'center'
        },
        right: {
          alignment: 'right'
        },
        bold: {
          bold: true
        }
      }
    };

    createpdf(docDefinition, this.courseId + ' Feedback Report');
  }

  getHeader(): Array<any> {
    const lineHeight = 1.0;

    const header = [
      {
        columns: [{
          width: 10,
          image: this.getLogo(),
          fit: [75, 75],
          margin: [30, 20, 0, 0]
        }
        ,
        [
          // { text: 'राष्ट्रीय प्रौद्योगिकी संस्थान पुदुच्चेरी', fontSize: 12, style: ['center'], margin: [10, 15, 0, 0]},
          {
            text: 'NATIONAL INSTITUTE OF TECHNOLOGY PUDUCHERRY', 
            fontSize: 16,
            lineHeight,
            style: ['center', 'bold'],
            margin: [35, 35, 0, 0]
          },
          {
            text: '(An Institute of National Importance under MHRD, Govt. of India)',
            fontSize: 12,
            lineHeight,
            style: ['center', 'bold'],
            margin: [35, 0, 0, 0]
          },
          {
            text: 'KARAIKAL - 609 609',
            fontSize: 16,
            lineHeight,
            style: ['center', 'bold'],
            margin: [35, 0, 0, 0] 
          },
        ]],
      },
      {
        text: '____________________________________________________________________________________________________',
        style: ['center']
      }
    ];
    return header;
  }

  getContent(courseId: string, course: string, faculty: string, feedback: Array<number>): Array<any>{

    const theoryQn = [
      'Lectures are well prepared',
      'Effectiveness of delivery of lectures and communication',
      'Knowledgable and makes the course interesting',
      'Encourages discussion, creative/ critical thinking and clears doubts',
      'Regular & punctual to the class',
      'Cycle test papers are evaluated and distributed in time',
      'Transparency and fairness of Evaluation system/ Internal Examinations',
      'Availability of the Faculty after class hours for guidance',
      'The prescribed syllabi is entirely completed',
      'The source material (books etc) for each portion covered in the syllabi is clearly informed'
    ];

    const labQn = [
      'Laboratories are well organized for experiments',
      'List of experiments are well defined',
      'Oppurtunity and facilities provided in the Lab for the use of theoritical knowledge gained in the classroom to learn and practice',
      'Skills and assistance provided during the Laboratory',
      'Transparency and fairness of Evaluation system for Laboratory Examinations'
    ];

    const data: any[] = [];
    let total = 0;

    const getRow = (i: number, typeOfCourse: 'theory' | 'lab'): Array<any> => {
      return [
        {
        text: (i + 1).toString(),
        style: ['center']
      },
      {
        text: (typeOfCourse === 'theory' ? theoryQn[i] : labQn[i])
      },
      {
        text: feedback[i],
        style: ['center']
      }];
    };
    let type: 'theory'| 'lab'| undefined;
    if (feedback.length === 10) {
      type = 'theory';
    }
    else if (feedback.length === 5) {
      type = 'lab';
    }

    if (!type) {
      return [];
    }

    const count = type === 'theory' ? 10 : 5 ;
    for (let i = 0; i < count; i++) {
      const row = getRow(i, type);
      data.push(row);
      total += feedback[i];
    }

    const totalText = 'Total ' + (type === 'theory' ? '(100)' : '(50)');
    const totalRow = ['',
                      { text: totalText, style: ['bold', 'right']},
                      { text: total.toString(), style: ['bold', 'center']}
                    ];
    data.push(totalRow);

    const content = [
      {text: 'Cumulative Feedback Report', fontSize: 12, style: ['bold', 'center'], margin: [0, 0, 0, 10]},
      {text: [ { text: 'Course Code : ', style: ['bold']}, courseId]},
      {text: [ { text: 'Course : ', style: ['bold'] }, course]},
      {text: [ { text: 'Faculty : ', style: ['bold'] }, faculty]},
      {
        margin: [0, 20, 0, 0 ],
        table: {
        headerRows: 1,
        widths: [ '10%', '*', '10%' ],
        body: [
          [
            { text: 'Sl. No', style: ['center', 'bold' ]},
            { text: 'Questionnaire', style: ['center', 'bold']},
            { text: 'Avg.\n(10)', style: ['center', 'bold']}
          ],
            ...data
        ]
      }},
      this.getRatingScale()
    ];
    return content;
  }

  getRatingScale(): Array<any> {
    const margin: any[] = [75, 0, 0, 0];
    const style: any[] = [];
    const ratingScale = [
      { text: [ 'Rating Scale : ', { text: '0 ≤ Point ≤ 3 : Poor', style}], margin: [0, 20 , 0, 0]},
      { text: '3 ≤ Point ≤ 6 : Average', style, margin},
      { text: '6 ≤ Point ≤ 8 : Good', style, margin},
      { text: '8 ≤ Point ≤ 10 : Very Good', style, margin},
    ];
    return ratingScale;
  }
  getLogo(): string {
    const logo = 'data:image/png;base64,';

    return logo;
  }
}
